import React, { Component } from "react";

class Head extends Component {
  render() {
    console.log("asdasd" + this.props);
    return (
      <div>
        <button onClick={() => this.props.history.push("/sobre")}>
          Ver Sobre
        </button>
      </div>
    );
  }
}
export default Head;
